import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

function model(props){
  
  return(
      <div className="card" style={{width: '30%', margin: 'auto'}}>
          <div className="card-head">
              <h2>{props.name}</h2>

          </div>
      </div>
  )
}

export default model;
